import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

def addRequest = testRunner.testCase.testSuite.testCases["AddCustomer"].testSteps["SOAP Request"].getPropertyValue("Request")

def xmlAdd= new XmlHolder(addRequest)

//xmlAdd.setNodeValue("XPATH","Value")
def name=testRunner.testCase.testSuite.testCases["AddCustomer"].getPropertyValue("Name")
def id=testRunner.testCase.testSuite.getPropertyValue("id")
def Department=testRunner.testCase.testSuite.testCases["AddCustomer"].getPropertyValue("Department")
def Age=testRunner.testCase.testSuite.testCases["AddCustomer"].getPropertyValue("Age")

xmlAdd.setNodeValue("//typ:addEmployee/typ:name",name)
xmlAdd.setNodeValue("//typ:addEmployee/typ:id",id)
xmlAdd.setNodeValue("//typ:addEmployee/typ:Department",Department)
xmlAdd.setNodeValue("//typ:addEmployee/typ:age",Age)

def newXml= xmlAdd.getXml()

testRunner.testCase.testSuite.testCases["AddCustomer"].testSteps["SOAP Request"].setPropertyValue("Request",newXml)

//Trigger the run Button
//steps to call the servoce with our code 
//Context of addEmplyee TestCase should be passed as Add step which we are trying to Run belong to that TEst Case
//To run any testStep we need to have context of that test step for that we have 1 class called WsdlTestRunContext

def pathToTestStep = testRunner.testCase.testSuite.testCases["AddCustomer"].testSteps["SOAP Request"]
def contextPower = new WsdlTestRunContext(pathToTestStep);
pathToTestStep.run(testRunner,contextPower)

//def getAddCustomerResOutput = testRunner.testCase.testSuite.testCases["AddCustomer"].testSteps["SOAP Request"].getPropertyValue[]


//hit GetEmployee and generate T

//def getEmployeeTestStep = testRunner.testCase.testSuite.testCases["CustomerInfo"].testSteps["SOAP Request"]

import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

//Place where Req and Response XML is placed
def testHoldingProperty=testRunner.testCase.testSuite.testCases["AddCustomer"].testSteps["SOAP Request"].getPropertyValue("Request")

def name = testRunner.testCase.testSuite.testCases["AddCustomer"].getPropertyValue("Name")
def age = testRunner.testCase.testSuite.testCases["AddCustomer"].getPropertyValue("Age")
def department = testRunner.testCase.testSuite.testCases["AddCustomer"].getPropertyValue("Department")
def id = testRunner.testCase.testSuite.getPropertyValue("id")

//Now we have to pass the Req XML we have fetched to XMLHolder Class 

def xmladd=new XmlHolder(testHoldingProperty)
//Now we will add the values to the Req XML we have fetched and then we will place it back to the Req path use setProperty value
xmladd.setNodeValue("//typ:addEmployee/typ:name",name)
xmladd.setNodeValue("//typ:addEmployee/typ:age",age)
xmladd.setNodeValue("//typ:addEmployee/typ:Department",department)
xmladd.setNodeValue("//typ:addEmployee/typ:id",id)

//Now we have to store this xml to new xml so that we can pass it in setProperty method

def newXML = xmladd.getXml()
//Successfully placed the new XML to request property at testStep Level.
testRunner.testCase.testSuite.testCases["AddCustomer"].testSteps["SOAP Request"].setPropertyValue("Request",newXML)

def addTestStep = testRunner.testCase.testSuite.testCases["AddCustomer"].testSteps["SOAP Request"]

def contextAddEmployee=new WsdlTestRunContext(addTestStep)
addTestStep.run(testRunner,contextAddEmployee)

//----------------------------------------------------------------

//Script to pass the name to CustomerInfo TestStep and check response of we are getting details or not

//Got testStep and stored it in a variable custInfo
def custInfo = testRunner.testCase.testSuite.testCases["CustomerInfo"].testSteps["SOAP Request"].getPropertyValue("Request")
//Set setNodeValue to name property define in line num 16
def xmladd2=new XmlHolder(custInfo)

xmladd2.setNodeValue("//typ:getEmployeeDetails/typ:employeeName",name)
//Save Xml into a new XML
def newXmlCustInfo = xmladd2.getXml();
//Place copied XMl back into the testStep Property
testRunner.testCase.testSuite.testCases["CustomerInfo"].testSteps["SOAP Request"].setPropertyValue("Request",newXmlCustInfo)

def contextCustInfo = new WsdlTestRunContext(testRunner.testCase.testSuite.testCases["CustomerInfo"].testSteps["SOAP Request"])

testRunner.testCase.testSuite.testCases["CustomerInfo"].testSteps["SOAP Request"].run(testRunner,contextCustInfo)

//Fetch The Request from CustomerInfo TestStep

def custInfoRes = testRunner.testCase.testSuite.testCases["CustomerInfo"].testSteps["SOAP Request"].getPropertyValue("Response")

def resCustInfo = new XmlHolder(custInfoRes)
def desiredRes = resCustInfo.getNodeValue("//ns:name")

log.info desiredRes
log.info name

assert desiredRes==name


//Code to delete employee

def delCustomerResXML = testRunner.testCase.testSuite.testCases["DeleteCustomer"].testSteps["SOAP Request"].getPropertyValue("Request")
def delCustomerResXMLplaced = new XmlHolder(delCustomerResXML)
delCustomerResXMLplaced.setNodeValue("//typ:deleteEmployee/typ:employeeName",name)

def savedDelCustXml = delCustomerResXMLplaced.getXml()

testRunner.testCase.testSuite.testCases["DeleteCustomer"].testSteps["SOAP Request"].setPropertyValue("Request",savedDelCustXml)

def contextDelCust = new WsdlTestRunContext(testRunner.testCase.testSuite.testCases["DeleteCustomer"].testSteps["SOAP Request"])

testRunner.testCase.testSuite.testCases["DeleteCustomer"].testSteps["SOAP Request"].run(testRunner,contextDelCust)
